column4:
{numberOfCertificates,plural, =1{Ο τομέας {orgName} εγκατέστησε μια αρχή έκδοσης πιστοποιητικών στη συσκευή σας, που ενδέχεται να του επιτρέψει να παρακολουθεί τη δραστηριότητα δικτύου της συσκευής, συμπεριλαμβανομένων των μηνυμάτων ηλεκτρονικού ταχυδρομείου, των εφαρμογών και των ασφαλών ιστοτόπων.

Για περισσότερες πληροφορίες σχετικά με αυτό το πιστοποιητικό, επικοινωνήστε με τον διαχειριστή σας.}other{Ο τομέας {orgName} εγκατέστησε αρχές έκδοσης πιστοποιητικών στη συσκευή σας, που ενδέχεται να του επιτρέψουν να παρακολουθεί τη δραστηριότητα δικτύου της συσκευής, συμπεριλαμβανομένων των μηνυμάτων ηλεκτρονικού ταχυδρομείου, των εφαρμογών και των ασφαλών ιστοτόπων.

Για περισσότερες πληροφορίες σχετικά με αυτά τα πιστοποιητικά, επικοινωνήστε με τον διαχειριστή σας.}}

